import React, { Component } from 'react';
import PropTypes from 'prop-types';

export default class MusicCard extends Component {
  getHtmlMusics = () => {

    return tracks;
  }

  render() {
    return (
      this.getHtmlMusics()
    );
  }
}

MusicCard.propTypes = {
  musics: PropTypes.shape({
    map: PropTypes.string.isRequired,
  }).isRequired,
};
